contracts/FreshTrack.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

contract FoodSupplyChain {

    struct FarmProduct {
        uint256 productId;
        string productDescription;
        string producerName;
        address producerAddress;
        uint256 harvestDate;
        string distributerName;
        address distributerAddress;
        uint256 prodToDistDate;
        string retailerName;
        address retailerAddress;
        uint256 distToRetaDate;
        bool isSold;
    }

    mapping(uint256 => FarmProduct) public products;
    uint256 public productCount;

    event ProductHarvested(uint256 productId, string productDescription, string producerName, address producerAddress, uint256 harvestDate);
    event ProductTransferred(uint256 productId, string fromStage, string toStage, address fromAddress, address toAddress, uint256 transferDate);
    event ProductSold(uint256 productId, address buyerAddress);

    // Function to harvest a new product
    function harvestProduct(string memory _productDescription, string memory _producerName, address _producerAddress, uint256 _harvestDate) public {
        productCount++;
        products[productCount] = FarmProduct(
            productCount,
            _productDescription,
            _producerName,
            _producerAddress,
            _harvestDate,
            "",
            address(0),
            0,
            "",
            address(0),
            0,
            false
        );

        emit ProductHarvested(productCount, _productDescription, _producerName, _producerAddress, _harvestDate);
    }

    // Function to transfer product from producer to distributor
    function transferToDistributor(uint256 _productId, string memory _distributerName, address _distributerAddress, uint256 _prodToDistDate) public {
        require(_productId <= productCount && _productId > 0, "Invalid product ID");
        require(products[_productId].distributerAddress == address(0), "Product already transferred");

        products[_productId].distributerName = _distributerName;
        products[_productId].distributerAddress = _distributerAddress;
        products[_productId].prodToDistDate = _prodToDistDate;

        emit ProductTransferred(_productId, "Producer", "Distributor", products[_productId].producerAddress, _distributerAddress, _prodToDistDate);
    }

    // Function to transfer product from distributor to retailer
    function transferToRetailer(uint256 _productId, string memory _retailerName, address _retailerAddress, uint256 _distToRetaDate) public {
        require(_productId <= productCount && _productId > 0, "Invalid product ID");
        require(products[_productId].retailerAddress == address(0), "Product already transferred");

        products[_productId].retailerName = _retailerName;
        products[_productId].retailerAddress = _retailerAddress;
        products[_productId].distToRetaDate = _distToRetaDate;

        emit ProductTransferred(_productId, "Distributor", "Retailer", products[_productId].distributerAddress, _retailerAddress, _distToRetaDate);
    }

    // Function for consumer to purchase the product
    function sellToConsumer(uint256 _productId) public {
        require(_productId <= productCount && _productId > 0, "Invalid product ID");
        require(!products[_productId].isSold, "Product already sold");

        products[_productId].isSold = true;

        emit ProductSold(_productId, msg.sender);
    }
}

